      <text id="73" justification="0" size="4" underlined="false">
        <text>If you want to use the PolyFitter packet, you should work with the Polyfitter
and the polyfitter.Point class.
 
How to Use Polyfitter:
- Create a PolyFitter (Construktors)
- set an Algorithm (Setters)
- set a Degree (Setters)
- fill the Polyfitter with some points by:
    o Using a set Points method (set Points will first empty existing Points)
    o Or using a addPoint Method
    o Or you already filled the Points with a Construktor 
 
Than you can:
- fit() to calculate the polynom
- plot() to visualize the polynom
- System.out.println(yourpolyfitter) to get a Table
- getProblem() to get the sum of the x(1D), y(2D) or z(3D) deviations
- getPolynom() to get the polynom
- getPolynomialReprasentation() to get the Polynom as a String (3x^2 - 1x^1 ...)</text>
      </text>
